тер. Затрачу время на решение ВАШЕЙ проблемы. Отремонтировав компьютер необходимо добраться домой и это тоже время и финансы. То бы из вас согласился выполнять работу за очень низкую цену или вообще бесплатно? Моя семья так же, как и ваша, хочет кушать, одеваться и периодически ездить на отдых. Я решу задачу по честной цене, качественно и в срок, обозначенный временным отрезком, решения именно этой проблемы. Я не стараюсь и не буду выполнять ненужные манипуляции с техникой, чтобы накрутить цену за работу. Чем быстрее я сделаю вам технику, тем быстрее получу за это оплату и благодарность от вас. Моя цена за работу на ремонт варьируется от 1200т.р до 3.500т.р. за полное восстановление работоспособности вашего компьютера! Всё остальное по телефону, ватсап и при личной встрече. Всё зависит от сложности и затраченному времени на ремонт. Я считаю, что это очень лояльный подход и ценовая политика. А как считаете вы? Я думаю и надеюсь, что мы с вами договоримся.
